import React from "react";

const Services = () => {
    return (
        <>
        <div className="my-3">
            <h1>Our Services</h1>
        </div>
            <div className="container-fluid nav_bg">
                <div className="row">
                    <div className="col-10 mx-auto ">
                        <div className="row"></div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Services;
